INSERT INTO `Comment_Issue` VALUES (261845579,190531498,'kennethreitz','✨?✨','2016-11-21 05:16:25'),(261859358,2162643,'greenrobot-team','@adjorno See [my comment on #427](https://github.com/greenrobot/greenDAO/issues/427#issuecomment-249506473) for an example. -ut','2016-11-21 07:02:46'),(262367026,146386005,'slavanap','@bitcrazed What about disclosing source code of `/init` binary? It *has to* use some of Ubuntu/Linux sources because it depends on `libc.so.6`. And it is non-Ubuntu binary for sure because it contains `lxssmanager` string inside.','2016-11-22 21:12:19'),(262782314,44336140,'gunthercox','Closing this ticket off as #276 is essentially the same thing except with a more defined scope.','2016-11-24 13:59:40'),(263154907,189339247,'mattrajca','`sudo-touchid` currently uses Apple\'s LocalAuthentication framework which only works with Touch ID. I\'m not aware of any other biometric APIs on macOS that would allow us to access third-party hardware.','2016-11-27 23:10:57'),(263195135,2162643,'greenrobot-team','As said this is exactly what [the Android loader framework is for](https://developer.android.com/guide/components/loaders.html). Just write your own [AsyncTaskLoader](https://developer.android.com/reference/android/content/AsyncTaskLoader.html). -ut','2016-11-28 06:44:38'),(263284505,186231864,'WANG-lp','+1','2016-11-28 14:28:58'),(263811404,192488738,'ittianyu','过奖了，打算加个类似于TabLayout的setupWithViewPager。您要是有什么建议还请issue。','2016-11-30 08:22:15'),(263947388,192635433,'tkipf','Thanks for reporting! This indeed seems to be an issue with the new TensorFlow version - I have just pushed a commit which should fix this (replaced tf.inv). I haven\'t upgraded to v0.12 yet but I\'ll test later. Let me know when you run into any other difficulties. Thanks! ','2016-11-30 18:04:15'),(263947671,192635433,'bwall','That did the trick thank you :)','2016-11-30 18:05:21'),(264496520,193145877,'kaushalmodi','Thank you. I will take some time to go through the man page. It\'s very informative and with lot of examples. :)','2016-12-02 16:28:40'),(264647611,193292890,'vadosnaprimer','Woah! Does it actually run properly on Linux too?','2016-12-03 16:03:24'),(264648397,193292890,'lefta','I only did a quick check but at least it loads and runs games. As this PR only add missing includes in fsnitro.cpp and missing files in Makefile.am it should not create any emulation problem.','2016-12-03 16:12:06'),(264650145,193292890,'vadosnaprimer','Woops I didn\'t notice it\'s desmume repo.','2016-12-03 16:41:44'),(264663531,193292890,'AaronBPaden','Build still fails if you build the gtk-glade frontend. Looks like the Makefile isn\'t generated.','2016-12-03 20:30:21'),(264668627,193292890,'lefta','@BPaden not anymore ;)','2016-12-03 22:04:10'),(264715554,128245456,'drunckoder','https://github.com/rubenlagus/TelegramBots/issues/161','2016-12-04 16:56:48'),(264718298,93587145,'a904guy','I\'m sorry for not responding! Thank you @yarrick :+1: :100: !!!','2016-12-04 17:43:08'),(264732073,193302627,'tkipf','No worries. What you describe is actually the intended behavior of the model. The setting we consider in this implementation is the following: we train on both labeled and unlabeled examples (i.e. semi-supervised learning) and later evaluate the predictions of the trained model on previously unlabeled examples. In this setting the model always performs a forward pass on the full dataset the mask only affects which labels are available to the model. All other nodes are treated as unlabeled nodes.','2016-12-04 21:19:49'),(264732375,193302627,'sufengniu','Thank you I found it. Just wondering did you ever try the gcn on multi-label graph (blogcatalog)? I tried it and it seems the performance is very poor. I basically change your softmax_cross_entropy to sigmoid_cross_entropy (and I masked each label). not sure if this is caused by code problem or model.','2016-12-04 21:24:16'),(264735758,193302627,'tkipf','I have not yet looked at multi-label classification but it would be interesting to investigate this further.','2016-12-04 22:13:25'),(264736271,193302627,'sufengniu','Thank you will close the issue','2016-12-04 22:21:16'),(264868458,193439509,'kafka0102','多谢回复，官方这个实现和第三方的比较起来实在太粗糙了，只能自己hack或者换种实现了。','2016-12-05 14:32:31'),(264885543,193439509,'ittianyu','客气了，没有其他疑问我就先关闭问题了。','2016-12-05 15:35:20'),(265203678,193145877,'kaushalmodi','Thank you for adding this feature. It is working great! ','2016-12-06 16:50:47'),(265304215,193912927,'tkoeppe','Are you running this remotely? You need an X server for GLX. Does the osmesa version work? ','2016-12-06 23:15:52'),(265305902,193898815,'tkoeppe','Just to be sure are you on x86-64? You can run `bazel build -s :lburg` to see the full command line invocations and find the command that failed; maybe that can get you a better error message?','2016-12-06 23:24:11'),(265384352,193978285,'jithinodattu','@xjwxjw sudo apt-get install realpath ','2016-12-07 08:18:05'),(265386159,193978285,'xjwxjw','I try the command :\"bazel run :random_agent --define headless=false --   --length=10000 --width=640 --height=480\"\". It is the same output as \"\"bazel run :random_agent --define headless=false\"\".\"','2016-12-07 08:27:39'),(265394938,165063921,'r3k2','Also will be nice for us that rather use Zaproxy ','2016-12-07 09:12:44'),(265421583,193978285,'tkoeppe','@xjwxjw: Thanks for investigating and @jithinoc for the pull request. You shouldn\'t have to preload libz since we compile it from source and link it statically. If there is a loading error could you try adding the \"undefined symbols\"\" to `dmlab.lds` first? (For an easy hack just replace the \"\"visible\"\" section in `dmlab.lds` by `*\'` and see if that resolves it and then narrow it down to the symbols that are actually used.)\"','2016-12-07 11:15:57'),(265462327,194064709,'miloyip','是觉得实在太老而且现在的参考价值太低。反而更老的 Graphics Gems 还有些算法可参考。','2016-12-07 14:34:57'),(265462824,194064709,'chena1982','哦，还有windows编程和debug的书好像没有。','2016-12-07 14:36:56'),(265514441,193898815,'ziXet','Those worked without any error. ','2016-12-07 17:32:07'),(265540632,193898815,'tkoeppe','Can you also try the optimized build `bazel build -c opt :game`?','2016-12-07 19:05:27'),(265571621,193898815,'ziXet','Same lburg build error','2016-12-07 20:59:36'),(265589239,193898815,'tkoeppe','Very odd. I\'ll see if we can find an ArchLinux distribution somewhere to test this. Sorry about that.','2016-12-07 22:09:51'),(265622614,190484333,'whummer','Fixed in 910dd53cd7f405a34fea00c29fd34d0677a55305','2016-12-08 01:02:16'),(265630949,194064709,'miloyip','Mathematica 有 《An Elementary Introduction to the Wolfram Language》。这本我读过。','2016-12-08 01:54:46'),(265631211,194064709,'miloyip','《Windows via C/C++ 5th Edition》 已经是 5 年前的了。这本我没读过。','2016-12-08 01:56:32'),(265677990,194266108,'miloyip','Thanks','2016-12-08 08:05:12'),(265951862,181550973,'jrobeson','analogRead is now implemented','2016-12-09 07:33:53'),(265986132,181550973,'me-no-dev','yup :)','2016-12-09 10:49:56'),(266277546,146473863,'felixfbecker','@rogalmic It\'s already possible in Insiders release','2016-12-11 11:48:37'),(266443188,143328813,'ajtulloch','I can update that branch with the new NNPACK API give me a few days. For caffe2 just building and setting engine=\"NNPACK\"\" in the OperatorDef is sufficient. For Torch https://github.com/szagoruyko/nnpack.torch/blob/master/SpatialConvolution.lua should work as well.\"','2016-12-12 14:24:21'),(266556488,178726666,'junyanz','I just uploaded a script `iGAN_predict.py\' for this. Let me know if it works for you. ','2016-12-12 21:21:38'),(266686357,190990834,'NicolasHug','Without bias this would be equivalent to PMF (http://papers.nips.cc/paper/3208-probabilistic-matrix-factorization.pdf eq. (5))','2016-12-13 09:17:15'),(266959719,81288411,'foreverGoUp','Could you tell me this function need which permisson? @markzhai  I have checked I already added some permissons like:android.permission.WRITE_EXTERNAL_STORAGEandroid.permission.READ_EXTERNAL_STORAGEandroid.permission.READ_PHONE_STATEbut they are not useful.','2016-12-14 07:07:50'),(267029963,193898815,'tkoeppe','I will close this for now; please reopen if you have new information (especially information on how to make it work on ArchLinux).','2016-12-14 13:11:21'),(267096307,8390031,'pjbakker','I think this can be closed now :)','2016-12-14 17:21:15'),(267097911,11977373,'silentjet','MotoX 1st gen (2013) works fine','2016-12-14 17:26:50'),(267191739,195649836,'nixawk','Thanks @patitoaxel . Good job.','2016-12-14 23:41:06'),(267574906,143328813,'dprylipko','@ajtulloch Andrew can I expect you are fixing the integration in the nearest future? This is the last piece of puzzle I don\'t have yet.','2016-12-16 11:29:25'),(267784765,196233958,'jungle-boogie','I had the same issue on freebsd 11-release.','2016-12-17 20:26:05'),(267784896,196233958,'p-gen','Thank you for reporting i\'ll try to fix that ASAP','2016-12-17 20:28:56'),(267855639,196233958,'p-gen','I pushed some new commits to try to solve the issue. Can you retry please?','2016-12-18 23:36:08'),(267931238,196233958,'dbaio','It worked perfectly. Thank you so much.','2016-12-19 10:28:56'),(267931363,196233958,'dbaio','Will you make a new release ?','2016-12-19 10:29:28'),(267935180,196233958,'p-gen','Soon I\'m waiting for other feedbacks.','2016-12-19 10:48:43'),(268093572,196496886,'p-gen','Thank you for your suggestion. I just pushed a commit to implement that.','2016-12-19 22:11:38'),(268098230,196493261,'p-gen','Can you be more precise? The \"usage\"\" function returns no value and the value returned by \"\"parse_sed_like_string\"\" is already tested.\"','2016-12-19 22:32:29'),(268173524,196496886,'elfring','Thanks for [your small improvement of the build scripts](https://github.com/p-gen/smenu/commit/2ca4c3261892bc056071f2eb5d6105cbe5c90f3d \"Improve the configure process\"\").\"','2016-12-20 07:24:50'),(268245293,196575937,'thaidn','Thanks randombit. We\'ll remove these dups soon.','2016-12-