rward to it!','2017-04-26 05:40:27'),(297276569,224321630,'yuanxiaofan','谢谢作者的分享！在内存方面确实能够及时释放！','2017-04-26 07:53:40'),(298263501,225338985,'yarwelp','Seconding this. Once a suitable license such as for example [the ISC license](https://choosealicense.com/licenses/isc/) has been chosen please include a copy of the license text in a file named `LICENSE` and be sure to add the year(s) name(s) and e-mail address(es) of the copyright holder in the section dedicated to said information.','2017-04-30 23:09:41'),(298264023,225338985,'zzw922cn','@MichaelScript @eriknstr Thanks for reminding me of license. I will add the MIT license to this repo soon.','2017-04-30 23:21:32'),(298502237,224310474,'Sayidssss','有错误贴出来，才能解决的。另外我这边小米7.1.1未崩溃','2017-05-02 05:42:57'),(299397729,219773316,'duxiansheng','I can covert it with Auducitybut there are a lot of work to do. And is there a way to covert all of .wav by code?','2017-05-05 07:11:50'),(299399807,219773316,'zzw922cn','@duxiansheng yes you can see my new code in timit or libri or wsj it can automatically process both wav and nist files.','2017-05-05 07:26:01'),(299543224,196586747,'SalusaSecondus','I think we\'d need the runners as well.','2017-05-05 18:37:29'),(299618106,224315879,'has2k1','The [gallery](http://plotnine.readthedocs.io/en/latest/gallery.html) is in place and is seeded with the first entries.','2017-05-06 05:51:45'),(299712659,226849113,'pgeorgi','We don\'t use github for integrating changes please see https://www.coreboot.org/Git for instructions how to push.','2017-05-07 15:11:56'),(299715275,226849113,'vincent-legoll','@pgeorgi here it is : https://review.coreboot.org/#/c/19617/','2017-05-07 15:54:08'),(299813192,225867163,'frameyl','I actually has another issue on Ubuntu during compiling. The default awk of ubuntu is mawk instead of gawk which also causing compiling issue. It can be wrote in help or FQA docs.','2017-05-08 09:05:16'),(299873974,213461461,'n8fr8','This seems to be working.','2017-05-08 13:56:58'