just has more to it that\'s considered less \"stable\"\" by Red Hat. Microsoft can do the same with WSL and vet certain parts just like is done now with the WSL team. The only difference is someone outside Microsoft makes some improvement or feature available for WSL the WSL team vets it to ensure the code is good and then go through the normal screening process. If something can be considered \"\"stable\"\" enough it could even go into non-Insiders. At this point in the game getting things such as FUSE AF_Packet and OpenCL/OpenGL implemented may be more easily accomplished by allowing developers outside of the WSL team to do the work for you. This will then satisfy the community (when it comes out as a \"\"surprise!\"\") and allow the WSL team to work on fixing bugs to make things more stable vice being forced to choose between whether a certain feature or bug has higher priority to meet Microsoft\'s vision to give developers a one-stop shop. \"','2018-01-17 13:46:48'),(358353636,146386005,'WSLUser','@erkinalp There\'s a difference between open-sourcing WSL and open-sourcing Windows 10. I do not expect them to open-source the OS (though that would be nice too a fantasy dream though) just the Linux subsystem portion. ','2018-01-17 16:09:21'),(358379355,242685725,'vsuthichai','I\'ve noticed that the output of `tf.contrib.seq2seq.dynamic_decode` will have `rnn_output` with shape [batch_size max_sentence_ref_length across entire batch num_classes] while the labels are the max sentence length with all the padding (this ends up being longer than the max_sentence_ref_length from `rnn_output`).  So it looks like I need to reshape my labels and remove the padding?','2018-01-17 17:27:46'),(358393285,146386005,'WSLUser','To back what @ssokolow has said Microsoft HAS open-sourced other applications such as Powershell and VSCode. Powershell specifically is deeply embedded in later versions of Windows because it\'s the replacement of CMD and they\'ve only left CMD in place for those who might favor it or have more experience using it. MS made it clear though that you have to know Powershell via certifications. But now you can install on any system with the only limitation being how fast they can make it available to everyone while fixing all the bugs that have resulted from making it open source. WSL will be slightly different in this case because of the underlying infrastructure is supposed to be based on a system that\'s already publicly known how to work for decades. This is why we have so many distros available and more can continue to be developed. All one needs to do is compare the code used to make something POSIX compliant and make something map to it inside the NT kernel. The WSL team themselves have said they try to use Windows APIs for everything to make things easier and of course provides better interop. Anybody can look at those APIs because without them there would be no software developed for Windows. We\'re not asking for a huge jump here it\'s simply a natural extension of everything MS has already done. If they want to take it one step further and make the whole OS open-source great! Eventually MS might find itself in that rabbit hole but as long as they\'re still able to make profit off of Windows I doubt they\'ll open-source it.','2018-01-17 18:13:32'),(358465735,242685725,'sleighsoft','The `sequence_length` parameter of `TrainingHelper` should be a vector containing the individual sequence lengths of all your labels within your batch excluding the padding','2018-01-17 22:11:45'),(359160005,289874226,'jiangnanrusheng','估计是代码合并的时候冲突了，解决不了，好几天了 o(╯□╰)o','2018-01-20 09:55:33'),(359315018,289874226,'CaoYusong','要等几天啊  啊啊 啊 阿啊 啊啊 啊 啊 去啊啊 阿啊  阿','2018-01-22 03:23:57'),(359319387,289874226,'windcaller31','官方的人呢，给个时间啊，最近想用突然就下线了','2018-01-22 04:03:22'),(359371437,289874226,'zuoyedalaohu','程序员 你摊上大事了！！！！','2018-01-22 09:42:07'),(359466262,286128226,'holachuy','Depends on new transfer types let\'s revisit this when we move over 