374081,271872272,'mbautin','@rahuldesirazu: I think we could do some optimizations for the pattern case. We could restrict the range of primary keys to scan in case the pattern does not start with a `*`. For each tablet we can start scanning find an existing hash value and immediately seek to the earliest key with that hash value that could match the pattern. When we scan all the keys with this hash value that match the pattern we will seek to the incremented hash value.','2018-04-06 20:51:42'),(379464596,312129824,'lucianodato','That\'s ok! No problem. Your work already helped me! I wasn\'t scaling to short values correctly. Now my plugin is working. From my test resampling gives pretty much the same result. RNNoise does much better as a VAD (vocal activity detector) than denoising algorithm. I can see how to integrate it to my other denoising plugin as that. Thank you very much! I can close this now.','2018-04-07 12:04:23'),(379464941,312129824,'werman','Good to know! If it\'s going to work even better with your plugin it would be awesome I\'ll try it out in future.','2018-04-07 12:11:55'),(379520547,312234048,'craigwi','Good idea.','2018-04-08 04:59:04'),(379575707,311791216,'endrift','`RETRO_DATA_PATH` lets you swap out everything from `site-packages/retro/data` but you still need `<game-title>/rom.md` folder structure. There is currently no way to have the ROMs loose and autodetected.','2018-04-08 19:28:13'),(379582389,312238113,'AirVetra','Thanks it works!','2018-04-08 21:03:09'),(379590023,311108063,'tanakataiki','Code for video added','2018-04-08 23:03:30'),(379591617,312234048,'craigwi','What shortcut key should I bind to this command?  ^p ?','2018-04-08 23:32:25'),(379648856,312410385,'msftclas','[![CLA assistant check](https://cla.opensource.microsoft.com/pull/badge/signed)](https://cla.opensource.microsoft.com/Microsoft/winfile?pullRequest=3) <br/>All CLA requirements met.','2018-04-09 06:34:39'),(379652024,312234048,'gbraad','@Allen-Wei I guess he meant