ble WINE while using this project. Cosmopolitan can only supports the stock behavior. I recommend avoiding binfmt_misc in general if possible.','2020-08-25 17:45:32'),(680176382,684328212,'0atman','Wine\'s not installed','2020-08-25 17:48:34'),(680189091,684327558,'jart','Glad you love the project. Sadly that\'s unlikely. APE assumes the build environment is hermetically sealed. wxWidgets works because it veneers dozens of system libraries e.g. qt x11 motif webkit cocoa wine sdl libpng libjpeg libtiff libxpm libiconv libmspack gtkprint gnomevfs opengl libnotify etc.  If you wanted it to work with APE then you\'d need to also schlep in its full transitive closure of dependencies. My personal view is web apps are awesome at fully featured guis terminals are awesome at being simple and anything in-between is better left to the unsung heroes of the Linux community!','2020-08-25 18:14:06'),(680268171,684328212,'omimo','I\'m not running Ubuntu in docker!','2020-08-25 21:02:10'),(680272822,684328212,'omimo','Another thing that might help in Ubuntu `/bin/sh` points to `/bin/dash`.','2020-08-25 21:13:02'),(680603191,684328212,'jart','Almquist shell works fine (outside FreeBSD which added restrictions to it) and is highly recommended. Try exploring the contents of `ls /proc/sys/fs/binfmt_misc/` and report back. I installed Ubuntu 20.01 server and didn\'t happen. It\'s possible that some other package that got installed on your machines possibly in the desktop base that\'s globally hooking shell scripts and then throws an error if the script starts with the letters \"MZ\"\".\"','2020-08-26 04:41:14'),(681154587,680760904,'Uzay-G','Do other people also think this is a useful feature?','2020-08-26 22:23:29'),(681928938,680760904,'clemux','I could see the value if archivy supported annotations (highlighting comments) but I can\'t see the use-case for now could you elaborate?','2020-08-27 12:52:00'),(682033274,680760904,'Uzay-G','It would be to serve your notes and other stuff as a public wiki other people could access. Like a blog except instead it would be a public wiki of your notes bookmarks etc...','2020-08-27 15:49:01'),(684141667,684328212,'jart','You\'re welcome! Thanks for the report. I\'ll update the Makefile shortly to auto-detect and report this workaround.','2020-09-01 01:45:21'),(684167304,684328212,'jart','Binfmt is absolutely not a requirement. I recommend against using it entirely. Cosmopolitan\'s executable format is just a shell script without a shebang line. Please read https://justine.storage.googleapis.com/ape.html to learn more. What happens is binfmt_misc gives people like package maintainers the ability to arbitrarily redefine how the kernel processes executables and in certain cases that break things.','2020-09-01 03:06:25'),(684172499,684328212,'chr15m','Understood thanks for the explanation.','2020-09-01 03:22:59'),(684931261,690229344,'atc1441','Thats a good idea will look into it ?','2020-09-01 15:17:01'),(684940401,690229344,'TheNitek','I think the idea was to advertise less often but I would vote against it. In my use case I implemented some kind of timeout so I rely on fix scheduled advertisments.','2020-09-01 15:30:39'),(684944543,690229344,'vevsvevs','@atc1441 Hmm.. So BLE-ADV sent out every second and only data in it got actualized every minute? You think that BLE-stuff doesn\'t take too much energy being activated every second? I\'m not quite sure (and I\'ll make test if necessary) but stock firmware advertise data only once per 10 minutes (5 if temp changed alot).','2020-09-01 15:37:08'),(684948113,690229344,'vevsvevs','Ahh I think I got it. Stock firmware should advertise some beakon-data every short time period to make the device discoverable so BLE-stuff is activating anyway. In that case your implementation shouldn\'t drain battery much more than original. Thanks for the info!','2020-09-01 15:42:15'),(684954137,690229344,'vevsvevs','Thank you! I\'ll try to make ESPHome integration for your data struc